import React from 'react';
import {Link, Switch, Route} from 'react-router-dom';
import Home from './components/home/Home';
import './index.css';

function App(props) {
  return (
    <div>


      <Switch>
        <Route exact path='/' render={() => <Home/>} />
      </Switch>
    </div>
  );
}

export default App;
